import { View, StyleSheet, Image, Text } from 'react-native';
import { TbLogout } from 'react-icons/tb'

const HomePage = ({ navigation }) => {
    return (
        <View style={styles.container}>
            <View style={styles.hello}>

                <Text onPress={() => {navigation.navigate('Login')}} style={styles.icon}><TbLogout/></Text>
            </View>

        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#120E0B',
        alignItems: 'center',
        width: '80%',
        marginTop: 30,
    },
    logo: {
        width: 45,
        height: 45,
    },
    name: {
        color: '#fff'
    },
    hello: {
        width: '80vw',
        alignItems: 'center',
        flexDirection: 'row',
        justifyContent: 'space-between'
    },
    cart: {
        width: '80vw',
        height: '20vh',
        backgroundColor: '#1F1D1B',
        flexDirection: 'column',
        padding: 20,
        borderRadius: 20,
        marginTop: 50,
    },
    iconMastercard: {
        width: 50,
        height: 30,
    },
    price: {
        color: '#fff',
        fontSize: '45px',
        marginTop: 20,
    },
    mastercard: {
        flexDirection: 'row',
        justifyContent: 'flex-end',
    },
    bold: {
        fontWeight: 'bold',
    },
    info: {
        flexDirection: 'row',
        justifyContent: "space-between",
        marginTop: 'auto'
    },
    infoDate: {
        color: '#fff',
        backgroundColor: '#5A5857',
        padding: '4px',
        borderRadius: 50,
    },
    infoCode: {
        color: '#5A5857',
    },
    userInfo: {
        flexDirection: 'row',
        alignItems: 'center',
    },
    icon: {
        color: '#5A5857',
        fontSize: 25
    }
});

export default HomePage;
